'use strict'


// use the straightforward compare method, can get correct answer but not good performance
function poisonousPlants(p) {
    let maxDays = 0, stack = [{ value: p[0], days: 0 }];
    stack.top = function () {
        return stack[stack.length - 1];
    };
    stack.isEmpty = function () {
        return stack.length === 0;
    };

    for (let i = 1; i < p.length; i++) {
        let currentValue = p[i], topStack = stack.top();
        if (currentValue > topStack.value) {
            stack.push({ value: currentValue, days: 1 });
            maxDays = Math.max(maxDays, 1);
        } else { // currentValue <= topStack.value 
            let partialMaxDays = topStack.days;
            while (currentValue <= topStack.value) {
                partialMaxDays = Math.max(partialMaxDays, topStack.days);
                stack.pop();
                if (stack.isEmpty())
                    break;

                topStack = stack.top();
            }

            if (stack.isEmpty())
                stack.push({ value: currentValue, days: 0 });
            else {
                stack.push({ value: currentValue, days: partialMaxDays + 1 });
                maxDays = Math.max(maxDays, stack.top().days);
            }
        }
    }

    return maxDays;
}

